import React, { Component } from 'react'
import TextInputBox from './TextInputBox'
import ScoreBar from './ScoreBar'
import './css/App.css'

class App extends Component{

    constructor(props){
        super(props)
    }

    render(){
        return(
            <div className="form-review">
                <h1>What do you think of the website?</h1>
                <TextInputBox />
                <h5>Positivity Score</h5>
                <ScoreBar />
                <button role="submit" id="submit_button">Submit Review</button>
            </div>
        )
    }
}

export default App
